import { Chart } from "frappe-charts/dist/frappe-charts.esm.js";
import "frappe-charts/dist/frappe-charts.min.css";
import React, { useState } from "react";
//import 'graphstyle.css';
import ReactFrappeChart from "react-frappe-charts";

var get_dates_before = function (fullArray, stopDate) {
  var dateArray = [];
  var dateIndex = 0;
  while (fullArray[dateIndex] != stopDate) {
    dateArray.push(fullArray[dateIndex]);
    dateIndex++;
  }
  return dateArray;
};

var get_dates_after = function (fullArray, stopDate) {
  var dateArray = [];
  var dateIndex = fullArray.length - 1;
  while (fullArray[dateIndex] != stopDate) {
    dateArray.push(fullArray[dateIndex]);
    dateIndex--;
  }
  return dateArray;
};

var parse_response = function (resp) {
  var change_transform = function (org) {
    var changed = org["values"];
    for (var i = 0; i < changed.length; i++) {
      changed[i]["date"] = new Date(changed[i]["date"]);
    }
    return changed;
  };

  var parsed = JSON.parse(resp);

  parsed[0]["value"] = new Date(parsed[0]["value"]);
  parsed[1]["value"] = new Date(parsed[1]["value"]);

  var parsed_transforms = parsed[2]["value"];
  parsed_transforms = parsed_transforms.map((transform) =>
    change_transform(transform)
  );
  parsed[2]["value"] = parsed_transforms;

  return parsed;
};

export const ExplorerGraph = () => {
  const json =
    '[{"name": "start_date", "value":"01-01-2020"},{"name": "end_date", "value":"01-04-2020"}, {"name": "Transformations", "value": [{"ticker": "AAPL","transformation": "Close","values":[{"date":"01-01-2020","values":[{"Close": 345.45}]},{"date":"01-02-2020","values":[{"Close": 325.45}]}]},{"ticker": "AAPL","transformation": "Pivot Points", "values":[{"date":"01-03-2020","values":[{"Pivot": 345.45},{"Resistance 1": 346.71}, {"Resistance 2": 348.71},{"Support 1": 343.71},{"Support 2": 341.71}]},{"date": "01-04-2020","values":[{"Pivot": 345.45},{"Resistance 1": 346.71},{"Resistance 2": 348.71},{"Support 1": 343.71},{"Support 2": 341.71}]}]}]}]';
  // Parse and label parts of response
  var esponse = parse_response(json);
  t = response[2];
  t_values = t["value"];
  start_date = response[0]["value"];
  end_date = response[1]["value"];

  // Find transform with << start date and >>> end date
  correct_start = t_values.filter(
    (transform) => transform[0]["date"].getTime() == start_date.getTime()
  )[0];
  correct_end = t_values.filter(
    (transform) =>
      transform[transform.length - 1]["date"].getTime() == end_date.getTime()
  )[0];

  // create array of dates from earliest start and array of dates from latest start
  start_array = correct_start.map((data) => data["date"].toString());
  end_array = correct_end.map((data) => data["date"].toString());

  // iterate through transforms and add empty dates to create consistent length
  for (var i = 0; i < t_values.lenght; i++) {
    var full_values = t_values[i];
    prepend_dates = get_dates_before(start_array, full_values[0]["date"]);
    for (new_date in prepend_dates) {
      entry = { date: new_date, values: [] };
      full_values.unshift(entry);
    }

    append_dates = get_dates_after(
      end_array,
      full_values[full_values.length - 1]["date"]
    );
    for (new_date in append_dates) {
      entry = { date: new_date, values: [] };
      full_values.push(entry);
    }
    t_values[i] = full_values; //can u change array in for each loop
  }
  reponse[2]["value"] = t_values;

  //split
  // Create full date array

  full_dates = response[2]["value"].map((full) => full["date"]);
  dataset_dictionary = {};
  // {"ticker": "AAPL","transformation": "Pivot Points", "values":[{"date":"01-03-2020","values":[{"Pivot": 345.45},{"Resistance 1": 346.71},

  // Create dataset of values for each transform and subtransform
  for (transform_index in response[2]["values"]) {
    transform = response[2]["values"][transform_index];
    const ticker = transform["ticker"];
    const transform_name = transform["transformation"];

    for (day_index in transform["values"]) {
      day = transform["values"][day_index];
      for (value_index in day["values"]) {
        value = day["values"][value_index];
        value_name = value.keys()[0];
        dataset_name = ticker + "(" + transform_name + ")" + " — " + value_name;
        if (!dataset_dictionary.keys().contains(dataset_name)) {
          dataset_dictionary[dataset_name] = [];
        }
        dataset_dictionary[dataset_name].push(value[value_name]);
      }
    }
  }

  // Convert dictionary into dataset
  datasets = [];
  for (dataset in dataset_dictionary) {
  }

  Object.keys(dataset_dictionary).forEach(function (key) {
    datasets.push({
      name: key,
      chartType: "line",
      values: dataset_dictionary[key],
    });
  });

  const data = {
    labels: full,

    datasets: datasets,

    yMarkers: [{ label: "High", value: 60, options: { labelPos: "left" } }],
  };

  return (
    <ReactFrappeChart
      data={data}
      title="APPL vs. MACD(MSFT)"
      type="axis-mixed"
      height="600"
      colors={["#25282A", "#492083", "light-blue"]}
      axisOptions={{
        xAxisMode: "tick",
        xIsSeries: true,
      }}
      barOptions={{
        stacked: false,
        spaceRatio: 0.2,
      }}
      tooltipOptions={{
        formatTooltipX: (d) => (d + "").toUpperCase(),
        formatTooltipY: (d) => d + " pts",
      }}
    />
  );
};
